import React, { useState } from 'react'




const App = () => {

    const pastTime = new Date().toLocaleTimeString();


    const [time, setTime] = useState(pastTime);

    const RealTime = () => {
        setTime(pastTime);
    };


    const [count, setCount] = useState(0);

    const IncNum = () => {
        setCount(count + 1);
    };

    const DecNum = () => {
        if (count <= 0) {
            alert("You can't go below zero");
        }
        else {
            setCount(count - 1);

        }

    };




    return (
        <>

            <h1>{count}</h1>
            <button onClick={IncNum}>Click Me</button>
            <button onClick={DecNum}>Click Me</button>
            <p>{time}</p>
            <button onClick={RealTime}>Get Time</button>
        </>
    )
}

export default App
